    .loader_c {
        position: absolute;
        top: 0;
        left: 0;
        width: 100vw;
        height: 100vh;
        background: #2e659c;
        z-index: 20;
    }

    .loader::before,
    .loader::after {
        content: "";
        display: block;
        position: absolute;
    }

    .loader::before {
        top: 0;
    }

    .loader::after {
        bottom: 0;
    }

    @keyframes blink {
        0% {
            opacity: 1;
        }
        99% {
            opacity: 0;
        }
        100% {
            opacity: 0;
        }
    }

    .loader_c.custom {
        background-size: 100% 100%;
        background: radial-gradient(farthest-side at bottom left, rgb(31 29 104 / 96%), transparent), radial-gradient(farthest-corner at bottom right, rgb(0 255 246 / 69%), transparent 400px);
    }

    .loader {
        background: var(--logo-image) top center/auto 100% no-repeat;
        background-size: contain;
        position: absolute;
        left: 50%;
        transform: translate(-50%, -50%);
        max-height: 80vh;
        width: 70%;
        filter: drop-shadow(0px 3px 3px rgb(0 0 0 / 1));
    }

    .loader.custom.no_img:before,
    .loader.custom.no_img::after {
        /*border-radius: 40px;*/
        width: 100%;
        margin: 0 auto;
        background-size: 100% 100%;
        background-repeat: repeat-x;
        z-index: 22;
        box-sizing: border-box;
        border: solid 0.1em #e4e4e4;
    }

    .loader.custom.no_img::after {
        width: 100%;
        box-shadow: inset 0 0.1em 0.1em rgba(255, 255, 255, 0.45);
        background: var(--fill);
        top: 140.5%;
    }

    .loader.custom.no_img::before {
        width: 102%;
        background: linear-gradient(180deg, #b1b1b1, #efefef);
        box-shadow: 0 0 1.25em 0 rgb(255 255 255 / 90%), inset 0 0 0.035em 0.03em #ffffff;
        top: 140%;
    }

    .no_img {
        background: none;
        width: 50%;
        filter: none;
    }

    @media (orientation: portrait) {
        @keyframes loading {
            0% {
                width: 5%;
            }
            100% {
                width: 130%;
            }
        }
        .loader {
            height: 15%;
            top: 45%;
        }

        .loader.custom.no_img:before {
            height: 30%;
            width: 132%;
            margin-left: -15.8%;
        }

        .loader.custom.no_img::after {
            height: 28%;
            width: 0;
            margin-left: -15%;
            animation: loading 1.5s linear forwards;
        }
    }

    @media (orientation: landscape) {
        @keyframes loading {
            0% {
                width: 5%;
            }
            100% {
                width: 100%;
            }
        }
        .loader {
            height: 25%;
            top: 40%;
        }

        .loader.custom.no_img:before {
            height: 30%;
            width: 101%;
            margin-left: -0.6%;
        }

        .loader.custom.no_img::after {
            height: 28%;
            width: 0;
            margin-left: 0;
            animation: loading 1.5s linear forwards;
        }
    }
